import React from "react";
import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import {useDispatch,useSelector} from "react-redux"
const Header = () => {
// const getName = localStorage.getItem("userLogin")

// console.log()
const userLogine= useSelector(localStorage.getItem("userLogin"))
    const userInfo = JSON.parse(userLogine)
  return (
    <>
      <Navbar bg="dark" data-bs-theme="dark">
        <Container>
          <Navbar.Brand href="#home">ItWox</Navbar.Brand>
          {userInfo ? 
            <Nav className="me-auto">
            <Nav.Link >{userInfo.name}</Nav.Link>
            <Nav.Link href="#features">Comments</Nav.Link>
          </Nav>
            :
            <Nav className="me-auto">
            <Nav.Link href="#home">JSON Get</Nav.Link>
            <Nav.Link href="#features">Comments</Nav.Link>
          </Nav>}
        </Container>
      </Navbar>
    </>
  );
};

export default Header;
